import './App.css';
import Slideshow from './components/SlideShow.js';
import Navbar from './components/NavBar.js';
import Test from "./components/Test.js";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {

  return (
    <div className="App">


      <div className="content">
        <BrowserRouter>
          <Route exact path="/">
            <Navbar />
            <Slideshow />
          </Route>
          <Route path="/test">
            <Test/>
          </Route>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
